import Logow from "../images/logow.png"
import Xpic from "../images/x.png"
import { motion } from "framer-motion"
export default function Menu(props){
    return(
        <motion.div className="h-[100vh] w-[99vw] bg-black p-5 "
        animate={{ x: 50 }}
        transition={{ type: "spring", stiffness: 100 }}
        >
            <div className="flex flex-row items-center justify-between">
                <img alt='img white' src={Logow} className="w-[45px] h-[36px] "></img>
                <img  onClick={props.toggle} alt='x' src={Xpic} className='cursor-pointer'></img>
            </div>

        </motion.div>
    )
}
